@myholeismycurse Hello, we are very sorry for the delay. We invite you to send us in DM a photo of your luggage if you have any, or a screenshot of its location if it is equipped with a GPS. 
You will then be assisted in the procedure to follow. 
Thank you, Clémence.

@Alexcorda1995 Salve Alessandro,
Ci rammarichiamo per gli eventi riportati e comprendiamo il suo stato d'animo riguardo l'annullamento del suo volo.
Per poterla  aiutare il più possibile, potreste indicarci suo codice di prenotazione in un  messaggio privato a: https://t.co/4cWulEZegx

@SimonCalder Hello @SimonCalder, thank you for your message. We will report this fake account to Twitter immediately. 
Have a nice day, 
Sandrine

@tibo_maker Hi @tibo_maker, our customer support team remains available, please kindly send a DM if you need a complementary assistance. 
Thank you. 
Sandrine

@leskill27 Olá, agradecemos seu contato.
Para atender melhor sua solicitação, pode por favor nos contatar por mensagem privada indicando o número de seu processo? 
Tenha um bom dia, Marine

@GreatScottFord The pleasure is all ours @GreatScottFord.
See you soon on board again ✈
Jimmy

@Justice4swartz Bonjour @Justice4swartz, si vous souhaitez être assisté sur votre dossier, nous vous invitons à contacter nos équipes en DM, comme indiqué le 4 novembre dernier. 
Nos conseillers sont à votre écoute. 
Bonne journée.

@Sarah_Pennells Hi again  @Sarah_Pennells, we 're sorry but our advisors can't find your DM. Can you please send it again ? 
Thank you. 
Sandrine

@lmgaveriaux Bonjour @lmgaveriaux, nous venons de demander à un de nos conseillers de vous assister à nouveau. Vous serez contactée en DM. 
Merci et bonne journée. 
Sandrine

@maudvallereau Bonjour @maudvallereau, 
Nous comprenons votre incompréhension. Pouvez-vous contacter un de nos conseillers de clientèle en DM afin d'être assistée s'il vous plait ? 
Merci.

@Sarah_Pennells Hi  @Sarah_Pennells, did you finally manage to pay your ticket ? 
Otherwise please kindly send to our customer service advisors a DM. 
Thank you ans have a nice day.

@SkymilesM Hi @SkymilesM, please kindly reach our dedicated assistants out by DMing them. 
You'll get an appropriate reply as soon as possible. 
Thank you.

@Cocoraralily Bonjour @Cocoraralily, nous vous remercions de partager votre expérience et sommes navrés que celle-ci n'a pas répondu à toutes vos attentes. 
Nous avons transmis votre message au service concerné. 
Bonne journée.

@Vanycoco83 Bonjour @Vanycoco83 , 
Nous vous invitons à passer en DM avec tous les détails de votre réservation qui permettront à nos assistants de clientèle de répondre à votre demande. 
Merci à vous.

@GodLourosa Bjr @GodLourosa, nous sommes navrés pour ces délais de traitement. Mais comme il vous l'a été indiqué le 26 octobre dernier, les temps de réponse du service réclamation sont allongés actuellement. 
Un lien de suivi de votre demande se trouve dans ce DM également. 
Bonne journée.

@lrrjhnsn Bonjour @lrrjhnsn, si vous souhaitez être aidé pour cette réservation, nous vous invitons à contacter un assistant de clientèle en envoyant un DM. 
Merci. 
Bonne journée.

@LauraaaaDo Bonjour  @LauraaaaDo, si vous souhaitez nous faire part des difficultés rencontrées lors de votre réservation, nous vous invitons à contacter un assistant de clientèle en envoyant un DM détaillé. 
Merci. 
Bonne journée.

@romainghezal Bonjour @romainghezal, un assistant de clientèle va revenir vers vous rapidement suite aux premiers échanges que vous avez eu en DM. 
Bonne journée, 
Sandrine

@anamorim92 Olá Ana, agradecemos seu contacto.
Para atender melhor sua solicitação, pode por favor nos contactar por mensagem privada indicando o número da sua reserva?
Tenha um bom dia, Marine

@Sdbelcher23 Hi @Sdbelcher23, please kindly send us a detailed DM in order to ge an assistance. 
Thank you. 
Sandrine

@ThibautGuignard @ThibautGuignard, pouvez-vous nous donner les détails de votre réclamation en privé afin qu'un conseiller de clientèle vous aide s'il vous plait ? 
Merci à vous. 
Sandrine

@ThibautGuignard Bonjour @ThibautGuignard, nous regrettons cet incident dans la livraison de vos bagages. Si vous avez déjà effectué votre réclamation en ligne, nous vous invitons à contacter un assistant de clientèle en DM afin qu'il vous accompagne dans vos démarches. 
Merci à vous. 
Sandrine

@ArnaudR95 @ArnaudR95, vous pouvez envoyer un DM si vous souhaitez une confirmation de votre enregistrement. 
Normalement, votre dossier comporte la mention "vous êtes enregistré" si vous avez effectué la procédure. 
Votre carte d'embarquement peut être récupérée à l'aéroport au départ.

@Nicolas29800 @Nicolas29800 c'est en cours de traitement. Il y a une file d'attente dans les demandes et nos conseillers de clientèle tentent de prioriser au mieux. 
Merci pour votre patience. 
Sandrine

@macsym @macsym, suite à vos DM reçus il y a qq minutes, nous avons demandé une prise en charge rapide de votre demande. Il y a une file d'attente mais vous serez priorisé. 
Bonne fin de journée. 
Sandrine

@arno1976 Bonjour  @arno1976, nous vous invitons à passer en DM avec tous les détails de votre réservation pour répondre à votre réclamation. 
Nous ne pouvons pas demander de prise en charge de votre dossier à un conseiller de clientèle sans ce message privé. 
Merci de votre compréhension.

@macsym Bonjour @macsym, nous sommes sincèrement navrés des difficultés de traitement actuellement.
Nous vous invitons à passer en DM avec tous les détails de votre réservation qui nous permettront de répondre au mieux à votre demande de remboursement.
Bonne journée.

@ArnaudR95 Bonjour @ArnaudR95, vous n'avez pas besoin d'imprimer votre billet d'avion et vous pouvez également vous enregistrer sur l'app sans imprimer votre carte d'embarquement. 
Nous vous souhaitons un bon voyage ! 
Sandrine

@noorghdr Bonjour @noorghdr, nous transmettons aux équipes à Luanda. 
Bonne journée, 
Sandrine

@DylanSr1 Bonjour @DylanSr1, un conseiller de clientèle va prendre contact avec vous en privé pour vous aider comme indiqué lors de votre dernier échange.
Bonne fin de journée, 
Sandrine

@svEscales Bonjour @svEscales, suite à vos précédents messages et à votre demande spécifique, un conseiller de clientèle vous contactera rapidement pour vous aider en DM. 
Bonne journée, 
Sandrine

@In_Sousse Bonjour @In_Sousse, pouvez-vous envoyer un DM à nos conseillers de clientèle pour votre demande s'il vous plait ? 
Merci et bonne journée. 
Sandrine
